import "./Delete.css";
import Axios from 'axios';
import React, {useEffect} from 'react';

function Delete(props){
    function deleteInspiration(id){
        useEffect(()=>{
            Axios.delete(`http://localhost:3001/api/delete/${id}`).then((response)=>{
                props.onCancelDeleteHandler();
            });
          },[]);
    }

    return (
        <div className="delete-popup">
            <h3>Are you sure you want to permenantly delete {props.title} from the interactivity library?</h3>
            <button type="button" onClick={deleteInspiration(props.id)}>Delete</button>
            <button type="button" onClick={props.onCancelDeleteHandler}>Cancel</button>
        </div>
    )

}

export default Delete;
